import React from 'react';
import logo from './logo.svg';
import './App.css';
import Message from './components/Message';

function App() {
  const data = [
    {name: 'Vasya', logo, title: 'Title', text: 'Hello World'},
    {name: 'Oleg', logo, title: 'Lol Oleg', text: 'Hello Peace'},
    {name: 'Maria', logo, title: 'Maria Lol', text: 'Hello'}
  ]

  return (
    <div className="App">
      <Message 
      name="Vasya"
      logo={logo}
      title="Title"
      text="Hello World"
      />   
    </div>
  );
}

export default App;
